import {React , useState} from 'react';

function T(){
  
    const[stud , setstud] = {
        name : "",
        age  : "",
        collage: "",
        status : ""
    }
    return(
        <section >
            <div>
            <input type="text" placeholder='name' value = {stud.name} onChange={()=> setstud(stud.name)} />
            <input type="number" placeholder='number' value = {stud.age} onChange={()=> setstud(stud.age)} />
            <input type="text" placeholder='name' value = {stud.collage} onChange={()=> setstud(stud.collage)} />
            <input type="text" placeholder='name' value = {stud.status} onChange={()=> setstud(stud.status)} />
        </div>
        <h2>{setstud.name}</h2>
        <h2>{setstud.age}</h2>
        <h2>{setstud.collage}</h2>
        <h2>{setstud.status}</h2>
        </section>
        
    )
}
export default T ;
